    render(){
      return (
        <div className='container'>
            <ToastContainer enableMultiContainer containerId={'B'} position={toast.POSITION.TOP_CENTER} />

            <button className="but" onClick={this.notifyB}>Where to Begin ? </button>          
        </div>
      );
    }

}

export default Home;
